import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import { Navbar } from "react-bootstrap";

const TweetNavbar = () => {
    return (
        <Navbar bg="dark" variant="dark">
            <Container>
                <Navbar.Brand href="#home">Navigation</Navbar.Brand>
                <Nav className="me-auto">
                    <Nav.Link href="../About/About">Home</Nav.Link>
                    <Nav.Link href="../Showcase/Showcase">Showcase</Nav.Link>
                    <Nav.Link href="../Random/Random">Random Tweets</Nav.Link>
                </Nav>
            </Container>
        </Navbar>
    );
};

export default TweetNavbar;
